<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <link rel="icon" href="%PUBLIC_URL%/favicon.ico" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <meta name="theme-color" content="#000000" />
    <meta
      name="description"
      content="Created by Cinque Web Development"
    />
    <link rel="preconnect" href="https://fonts.gstatic.com">
    <link href="https://fonts.googleapis.com/css2?family=Bitter:wght@300&family=Patua+One&family=Montserrat:wght@700&family=Roboto:wght@100&family=Lobster+Two:wght@700&family=Varela+Round&family=Comfortaa:wght@300;600&family=Bree+Serif&family=Tomorrow:wght@500&family=Crimson+Text:wght@700&display=swap" rel="stylesheet">
    <link rel="apple-touch-icon" href="%PUBLIC_URL%/logo192.png" />
    <link rel="manifest" href="%PUBLIC_URL%/manifest.json" />
    <link
      rel="stylesheet"
      href="https://pro.fontawesome.com/releases/v5.10.0/css/all.css"
      integrity="sha384-AYmEC3Yw5cVb3ZcuHtOA93w35dYTsvhLPVnYs9eStHfGJvOvKxVfELGroGkvsg+p"
      crossorigin="anonymous"
    />
    <link rel="canonical" href="https://cinque.cinquewd.com"/>
    <title>Cinque</title>
  </head>
  <body>
    <noscript>You need to enable JavaScript to run this app.</noscript>
    <div id="root"></div>
    <script>
      if("serviceWorker" in navigator) {
        window.addEventListener('load', () => {
          navigator.serviceWorker
          .register('./serviceWorker.js')
          .then((reg) => console.log("Success ", reg.scope))
          .catch((err) => console.log("Failure ", err))
        });
      }
    </script>
  </body>
</html>
